INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", 401, 2, 2, 24001, 0.0, 0.0, "アヤネ", "2030/12/17 14:59:59", 0.0, 24, 10046, 102301, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", 402, 2, 1, 24002, 0.0, 2.21, "アヤネ", "2030/12/17 14:59:59", 0.0, 24, 10046, 102301, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", 403, 2, 2, 24003, 0.0, 0.0, "アヤネ", "2030/12/17 14:59:59", 0.0, 24, 10046, 102301, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", 701, 1, 2, 24004, 0.0, 1.99, "アサヒ", "2030/12/17 14:59:59", 0.0, 24, 10046, 192201, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", 702, 2, 1, 24005, 0.0, 2.21, "アサヒ", "2030/12/17 14:59:59", 0.0, 24, 10046, 192201, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", 703, 1, 2, 24006, 0.0, 3.33, "アサヒ", "2030/12/17 14:59:59", 0.0, 24, 10046, 192201, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", 801, 2, 2, 24007, 0.0, 0.0, "部員３", "2030/12/17 14:59:59", 0.0, 24, 10046, 192301, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", 802, 2, 1, 24008, 0.0, 2.68, "部員３", "2030/12/17 14:59:59", 0.0, 24, 10046, 192301, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", 803, 2, 2, 24009, 0.0, 0.0, "部員３", "2030/12/17 14:59:59", 0.0, 24, 10046, 192301, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", 501, 1, 1, 24010, 0.0, 0.0, "", "2030/12/17 14:59:59", 0.0, 24, 10046, 192501, "やった！");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", 502, 1, 1, 24011, 0.0, 0.0, "", "2030/12/17 14:59:59", 0.0, 24, 10046, 192501, "勝ったよ！");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", 503, 1, 1, 24012, 0.0, 0.0, "", "2030/12/17 14:59:59", 0.0, 24, 10046, 192501, "いい調子！");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", 111, 2, 6, 24013, 0.0, 5.33, "ミサト", "2030/12/17 14:59:59", 0.0, 24, 10046, 113501, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", 112, 2, 1, 24014, 0.0, 6.85, "ミサト", "2030/12/17 14:59:59", 0.0, 24, 10046, 113501, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", 113, 2, 1, 24015, 0.0, 3.0, "ミサト", "2030/12/17 14:59:59", 0.0, 24, 10046, 113501, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", 611, 2, 1, 24016, 0.0, 6.11, "ダイチ", "2030/12/17 14:59:59", 0.0, 24, 10046, 192401, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", 612, 2, 1, 24017, 0.0, 6.75, "ダイチ", "2030/12/17 14:59:59", 0.0, 24, 10046, 192401, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", 613, 2, 2, 24018, 0.0, 0.0, "ダイチ", "2030/12/17 14:59:59", 0.0, 24, 10046, 192401, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", 211, 1, 2, 24019, 0.0, 4.52, "ハツネ", "2030/12/17 14:59:59", 0.0, 24, 10046, 113401, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", 212, 1, 2, 24020, 0.0, 3.89, "ハツネ", "2030/12/17 14:59:59", 0.0, 24, 10046, 113401, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", 213, 2, 1, 24021, 0.0, 13.49, "ハツネ", "2030/12/17 14:59:59", 0.0, 24, 10046, 113401, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", 311, 2, 1, 24022, 0.0, 3.17, "カヤ", "2030/12/17 14:59:59", 0.0, 24, 10046, 106501, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", 312, 2, 1, 24023, 0.0, 4.42, "カヤ", "2030/12/17 14:59:59", 0.0, 24, 10046, 106501, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", 313, 1, 6, 24024, 0.0, 2.89, "カヤ", "2030/12/17 14:59:59", 0.0, 24, 10046, 106501, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", 421, 3, 4, 24025, 0.0, 3.71, "アヤネ", "2030/12/17 14:59:59", 0.0, 24, 10046, 102301, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", 721, 1, 2, 24026, 0.0, 5.1, "アサヒ", "2030/12/17 14:59:59", 0.0, 24, 10046, 192201, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", 821, 3, 1, 24027, 0.0, 4.34, "部員３", "2030/12/17 14:59:59", 0.0, 24, 10046, 192301, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", 521, 1, 1, 24028, 0.0, 0.0, "", "2030/12/17 14:59:59", 0.0, 24, 10046, 192501, "いい勝負だったよ\nまたやろうね");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", 101, 2, 1, 24029, -360.0, 5.62, "ミサト", "2030/12/17 14:59:59", 0.0, 24, 10046, 113501, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", 102, 2, 1, 24030, -360.0, 9.58, "ミサト", "2030/12/17 14:59:59", 0.0, 24, 10046, 113501, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", 103, 2, 2, 24031, -360.0, 0.0, "ミサト", "2030/12/17 14:59:59", 0.0, 24, 10046, 113501, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", 104, 1, 2, 24032, -360.0, 9.13, "ミサト", "2030/12/17 14:59:59", 0.0, 24, 10046, 113501, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", 105, 2, 1, 24033, -360.0, 8.27, "ミサト", "2030/12/17 14:59:59", 0.0, 24, 10046, 113501, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！");
